import React from 'react';
import { Slide } from 'react-slideshow-image';
import img1 from "../../images/slideimg1.jpg";
import img2 from '../../images/slideimg2.jpg';
import img3 from '../../images/slideimg3.jpg';
import img4 from '../../images/slideimg4.jpg';

import './slide.css';


function Slideimg() {
   const url=[img1,img2,img3,img4] ;
   const divStyle = {
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center',
    backgroundSize: 'cover',
    height: '400px'
  }
  return (
    <div className='slide'>
      <Slide>
        {url.map((image,index)=>{
         <div key={index}>
          <div style={{ ...divStyle, 'backgroundImage': `url(${url})` }}></div>
         </div>
        })

        }
      </Slide>

    </div>
  )
}

export default Slideimg;
